import React from 'react';
import '../App.css';
import { useState } from 'react';
import { motion } from "framer-motion";

function ExperienceTable() {
  const experienceItem = experience.map(job =>
    <ExperinceDisplay job={job} />
  )
  return (
    <div className="ExperienceTable">
      <h2>Experience</h2>
      {experienceItem}
    </div>
  )
}

function ExperinceDisplay({job}) {
  return (
    <div className="ExperienceDisplay">
      <h5>{job.name}</h5>
    </div>
  )
}


const experience = [
  {name: "Amazon", desc: ""},
  {name: "Assure-US", desc: ""}
]

export default ExperienceTable
